import React from 'react';
import InfoBox from './InfoBox';
/** @function Summary  */

function Summary(props) {
  const {
    totalConfirmed,
  } = props;

  return (
        < div className='block_global'>
             <InfoBox
              title="Global Cases"
              total ={totalConfirmed}
                                     />

         <h4>{new Date().toDateString()}</h4>
            </div>
  );
}
export default Summary;
